import React from 'react';
import './App.css';
import { Route, Routes, Link } from 'react-router-dom';
import Home from './pages/home';
import Myinfo from './pages/myinfo';

function App() {
  return (
    <Routes>
      <Link to="/">Home</Link>
      <Link to="pages">Myinfo</Link>
    </Routes>
  );
}

export default App;
